import React from "react";
import { Grid, Container, Button, Input } from "semantic-ui-react";

function App() {
  return (
    <Container>
      <Grid>
        <Grid.Row>
          <Input type="file" />
          <Button>Hello</Button>
        </Grid.Row>
      </Grid>
    </Container>
  );
}

export default App;
